/*!50003 CREATE*/ /*!50017 DEFINER=`OSM_CLIENT`@`localhost`*/ /*!50003 TRIGGER CHECK_EDGE_ORDER_ON_INSERT
BEFORE INSERT ON EDGE
FOR EACH ROW
BEGIN
    DECLARE temp int(2);
    select count(*) into temp 
      from edge where 
        (begin_id=NEW.begin_ID and DEST_ID=NEW.dest_ID) or
        (begin_id = NEW.DEST_ID and DEST_ID = NEW.BEGIN_ID);
        
    IF (temp <> 0) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Edge is already declared';
    END IF;

END */;;
